/**
 *
 * Navigation.js
 * @author Peter Laxalt
 * @description The website Navigation.
 *
 */

// Core
import React from "react";
import Link from "next/link";

// Styles
import { ListingsStyle } from "./styles.scss";

// Constants
import { Theme } from "../../constants/Theme";

// Begin Interface
//////////////////////////////////////////////////////////////////////

interface Listing {
  name: string;
  href: string;
  theme: string;
  idx: number;
}

// Begin Component
//////////////////////////////////////////////////////////////////////

const projectsPrefix = "/projects";

const projects = [
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Primary
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Warning
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Ocean
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Dino
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Cream
  }
];

const Listing = ({ name, href, theme, idx }: Listing) => (
  <Link href={href} idx={idx}>
    <div className="listing">
      <span>{name}</span>
      <span>{theme}</span>
    </div>
  </Link>
);

export const Listings = () => (
  <ListingsStyle>
    <div className="inner">
      {projects.map((project, idx) => {
        return (
          <Listing
            name={project.name}
            href={project.href}
            theme={project.theme}
            idx={idx}
          />
        );
      })}
    </div>
  </ListingsStyle>
);

// End Component
//////////////////////////////////////////////////////////////////////
